import './App.css';
import { ResizableBox } from 'react-resizable';    // npm install --save react-resizable



function App() {

  return (
    <div id="App">

      {/*Header bar on top of the screen*/}
      <div id="headerBar">

        <div id="logo"></div>

        <div id="dropdown-containers"></div>

      </div>


      {/*Containing the code editor and the output panel*/}
      <div id="workspace">

        <div id="editor"></div>

        <ResizableBox id="outputPanel">
          <div id="output"></div>
        </ResizableBox>

      </div>

    </div>
  );
}

export default App;
